--
-- Name: update_exp_last_updated(); Type: FUNCTION; Schema: public; Owner: peri
--

CREATE FUNCTION update_exp_last_updated() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
  IF (TG_OP = 'UPDATE') OR (TG_OP = 'DELETE') THEN
    UPDATE experiments SET last_updated = now() WHERE experiment_id = OLD.experiment__id;
    RETURN OLD;
  ELSIF (TG_OP = 'INSERT') THEN
    UPDATE experiments SET last_updated = now() WHERE experiment_id = NEW.experiment__id;
    RETURN NEW;
  END IF;
  RETURN NULL;
EXCEPTION
 WHEN UNIQUE_VIOLATION THEN
 -- do nothing
 RETURN NULL;
END;
$$;


ALTER FUNCTION public.update_exp_last_updated() OWNER TO peri;

--
-- Name: update_last_updated_column(); Type: FUNCTION; Schema: public; Owner: peri
--

CREATE FUNCTION update_last_updated_column() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
NEW.last_updated = now();
RETURN NEW;
END;
$$;


