--
-- Name: update_ts_en_conclusions(); Type: FUNCTION; Schema: public; Owner: peri
--

CREATE FUNCTION update_ts_en_conclusions() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
begin
  new.ts_en :=
     setweight(to_tsvector('english', coalesce(new.description,'')), 'A');
  return new;
end
$$;


ALTER FUNCTION public.update_ts_en_conclusions() OWNER TO peri;

